import React from "react";
import { Link } from "react-router-dom";
import "./styles/AppTabs.css";

function AppTabs() {
  return (
    <ul className="nav appNavs">
      <li className="nav-item">
        <Link to="/" className={window.location.pathname === "/login" ? "nav-link active" : "nav-link"} data-toggle="modal" data-target="#exampleModal">
          Log In
        </Link>
      </li>
      <li className="nav-item">
        <Link to="/" className={window.location.pathname === "/signup" ? "nav-link active" : "nav-link"} data-toggle="modal" data-target="#exampleModal">
          Sign Up
        </Link>
      </li>
    </ul>
  );
}

export default AppTabs;
